## Table



::: {.cell}

```{.r .cell-code}
summary_table_all %>%
gt() %>%
  tab_header(
    title = "All-time Summaries"
  ) %>%
  fmt_number(
    columns = where(is.numeric), 
    decimals = 2
  )%>%
  cols_label(
    Min_mean = "Mean", 
    Min_sd = "SD", 
    Mean_mean = "Mean", 
    Mean_sd = "SD", 
    Max_mean = "Mean",
    Max_sd = "SD"
  ) %>%
  tab_spanner(
    label = "Monthly Minimums",
    columns = c(Min_mean, Min_sd)
  ) %>%
  tab_spanner(
    label = "Monthly Means",
    columns = c(Mean_mean, Mean_sd)
  ) %>%
  tab_spanner(
    label = "Monthly Maximums",
    columns = c(Max_mean, Max_sd)
)
```

