summary_table <- monthly_weather %>% 
  mutate(season = factor(season, levels = c("Winter", "Spring", "Summer", "Fall"))) %>%
  group_by(season) %>%
  summarise(
    Min_mean = mean(min, na.rm = T), 
    Min_sd = sd(min, na.rm = T),
    Mean_mean = mean(mean, na.rm = T), 
    Mean_sd = sd(mean, na.rm = T),
